import React from "react";
import { Col, Row, Container } from "react-bootstrap";
import Footer from "./footer";
import HeaderNav from "./HeaderNav";
import ModalOne from "./modal"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faDesktop, faKeyboard, faMousePointer } from '@fortawesome/free-solid-svg-icons'

function MainPage() {
  return (
    <div className="box">
      <HeaderNav />
      {/*  <div className="d-flex justify-content-center mt-5">
        <h1 className="title">Logo</h1>
      </div>  */}
      <Container className="bodyContainer">
        <Row className="w-100">
          <Col className="d-flex justify-content-center">
            <h1>Apply some text here.</h1>
          </Col>
          <Col className="d-flex justify-content-center">
            <div className="position-relative">
            <div >
            <span className="circle"><FontAwesomeIcon id="icons" icon={faMousePointer} /><ModalOne/></span></div>

            <div id="circleDouble"> 
            <span className="circle"><FontAwesomeIcon id="icons" icon={faKeyboard} /></span>
           <span className="circle"><FontAwesomeIcon id="icons" icon={faDesktop} /></span>
           </div>
           </div>

          </Col>
        </Row>
      </Container>
      <Footer />
    </div>
  );
}

export default MainPage;
